import './App.css';

function App() {
  return (
    <nav className="shadow-md w-full fixed top-0 left-0">
      <div className="fixed w-[676px] h-[36px] top-0 left-0">
        <div className="relative w-[672px] h-[36px] bg-[#2c82c942]">
          <div className="absolute top-[14px] left-[14px] [font-family:'Josefin_Sans',Helvetica] font-normal text-white text-[12px] tracking-[0] leading-[normal] whitespace-nowrap">
            PersonaFitAI
          </div>
          <div className="absolute w-[62px] h-[26px] top-[9px] left-[587px] bg-[url(https://c.animaapp.com/tAUnDrST/img/rectangle-7.svg)] bg-[100%_100%]">
            <div className="absolute w-[38px] top-[3px] left-[15px] [font-family:'Josefin_Sans',Helvetica] font-normal text-[#424b54] text-[10px] tracking-[0] leading-[normal]">
              Sign In
            </div>
          </div>
        </div>
      </div>
    </nav>
  );
}

export default App;
